package com.java;
import java.util.*;
public class cube {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
    Scanner sc=new Scanner(System.in);
    System.out.println("Enter a number - ");
    int n=sc.nextInt();
    for(int i=1;i<=n;i++) {
    	  System.out.println("cube of "+i+" is "+i*i*i);
    	  
    }
	}

}
